{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/sirakzeray/case-study-how-does-a-bike-share-navigate-speedy?scriptVersionId=125725801\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"305d794e","metadata":{"papermill":{"duration":0.009505,"end_time":"2023-04-14T01:43:27.221315","exception":false,"start_time":"2023-04-14T01:43:27.21181","status":"completed"},"tags":[]},"source":["<h1>Case Study: How Does a Bike-Share Navigate Speedy Success?</h1>"]},{"cell_type":"markdown","id":"85cf96cb","metadata":{"papermill":{"duration":0.007713,"end_time":"2023-04-14T01:43:27.237105","exception":false,"start_time":"2023-04-14T01:43:27.229392","status":"completed"},"tags":[]},"source":["<b>Sirak Zeray - 02/15/23</b> \n","\n","This case study was given while I was taking a google data analytics professional certificate course. The data analysis will be performed using the 6 steps of the data analysis process: Ask, Prepare, Process, Analyze, Share, and Act.\n","\n","<b>Scenario</b>\n","\n","You are a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore,your team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, your team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve your recommendations, so they must be backed up with compelling data insights and professional data visualizations."]},{"cell_type":"markdown","id":"783578b0","metadata":{"papermill":{"duration":0.008253,"end_time":"2023-04-14T01:43:27.253559","exception":false,"start_time":"2023-04-14T01:43:27.245306","status":"completed"},"tags":[]},"source":["<h2>The 6 steps of data analysis process</h2>\n","\n","<h3>1.Ask</h3> \n","\n","<b>What is the problem you are trying to solve?</b>\n","    \n","    To find how casual and member bike riders use the service differently. \n","\n","<b>How can your insights drive business decisions?</b>\n","    \n","    The insight is to change casual riders to members.\n"]},{"cell_type":"markdown","id":"c167b5a4","metadata":{"papermill":{"duration":0.007738,"end_time":"2023-04-14T01:43:27.269187","exception":false,"start_time":"2023-04-14T01:43:27.261449","status":"completed"},"tags":[]},"source":["<h3>2.Prepare</h3>\n","\n","The dataset can be found in kaggle,but I use the data that was given in the course to get the recently  updated one. since the combined csv files have more than 5 million rows, excel couldn't handle it. I also tried to do it in BigQuery, however, I couldn't upload some files that have more than 100 MB. So I decided to do the whole process in R. The file is organized for each month and it doesn't have issues with bias and credibility because it comes from the company database. "]},{"cell_type":"code","execution_count":1,"id":"c24ea05c","metadata":{"execution":{"iopub.execute_input":"2023-04-14T01:43:27.28895Z","iopub.status.busy":"2023-04-14T01:43:27.286727Z","iopub.status.idle":"2023-04-14T01:43:28.990463Z","shell.execute_reply":"2023-04-14T01:43:28.988664Z"},"papermill":{"duration":1.715887,"end_time":"2023-04-14T01:43:28.992942","exception":false,"start_time":"2023-04-14T01:43:27.277055","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.4.0      \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 1.0.1 \n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n","\u001b[32m✔\u001b[39m \u